■自動車・船舶用炊飯器「タケルくん」 1.5合<br>
■車で使える炊飯器<br>
■無洗米とミネラルウォーターを規定量入れて、炊飯スイッチを押すだけで簡単にご飯が炊けます！<br>
■本体サイズ:W160×D140×H155mm  <br>
■本体重量:592g<br>
■電源:DC24V<br> 
■製品保障:1年<br>
